import React from "react";
import "./style.css";

const Team = ({ name, description, avatar }) => (
    <div className="mpl-box-md">
      <div className="container">
        <h2 className="display-2 mb-60 text-center" data-sr data-sr-duration="1200" data-sr-distance="20">
          Team
        </h2>
    </div>
    </div>    
);

export default Team;
